import React, { Component } from 'react'

export class Card extends Component {
    render() {
        const style = {

            height: "20%",
            margin: "1em"
        }
        return (

            <div class="card" style={style}>
              <img className="card-body" src="https://vignette.wikia.nocookie.net/villains/images/a/a3/GollumAUJTextlessPoster.jpeg/revision/latest?cb=20151020122542" alt="Gollum"/>
            </div>
        )
    }
}

export default Card;
